import React from 'react'
import Aa from './MyComponent/User_view'
import Ab from './MyComponent/Add_book'

import Sign from './MyComponent/Sign'

import {Route,Link,Routes} from 'react-router-dom';

function App() {
    return (
        <div>
             <a class="nav-link active" aria-current="page" href="/home">Home</a>
             <a class="nav-link active" aria-current="page" href="/add">Add Book</a>
             <a class="nav-link active" aria-current="page" href="/sign">Signin</a>

            
            <Routes>

                <Route  path = "/home" element = {<Aa/>}/>
                <Route  path = "/add" element = {<Ab/>}/>

               <Route  path = "/Sign" element = {<Sign/>}/>
                </Routes>



        </div>
    );
}
export default App
